import { useEffect, useState } from "react";
import ListItem from "./ListItems/ListItem";
const Products = () => {

    const [items, setItems] = useState([
        {
            id: 0,
            discountedPrice: 380,
            price: 450,
            title: "Title 1",
            thumbnail: "placeholder.png"
        },
        {
            id:1,
            discountedPrice: 200,
            price: 310,
            title: "Title 2",
            thumbnail: "placeholder.png"
        },
        {
            id:2,
            discountedPrice: 100,
            price: 120,
            title: "Title 3",
            thumbnail: "placeholder.png"
        }
    ])

    useEffect(()=>{
        const result = fetch(`https://shopping-app-b9c1a-default-rtdb.firebaseio.com/items.json`)

    },[]) 
    return (
        <div className={"product-list"}>
            <div className={"product-list--wrapper"}>
                {items.map((item)=>{
                    return <ListItem key={item.id} data={item}/>
                })}

            </div>
        </div>
    )

}
export default Products;
